import React from 'react'


const Cell = ({value}) => {
  return( 
  <div  style={style.cellStyle}>
    {value}
  </div>
    
  )
};
const style = {
  cellStyle:{
    width:50, height:50, background: "#97ccde",
    display:'flex',
    justifyContent:'center',
    alignItems:'center'

  }
}
export default Cell
